import { useState } from 'react';

const PackingList = () => {
  const [packingItems, setPackingItems] = useState([]);
  const [item, setItem] = useState('');

  const handleChange = (event) => {
    setItem(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    setPackingItems([...packingItems, item]);
    setItem('');
  };

  const handleDelete = (index) => {
    setPackingItems(packingItems.filter((_, i) => i !== index));
  };

  return (
    <div>
      <h2>Packing Checklist</h2>
      <form onSubmit={handleSubmit}>
        <input type="text" value={item} onChange={handleChange} placeholder="Add item" />
        <button type="submit">Add</button>
      </form>
      <ul>
        {packingItems.map((item, index) => (
          <li key={index}>
            {item} <button onClick={() => handleDelete(index)}>Remove</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PackingList;
